const DUMMY_EVENTS = [
  {
    id: "event-1",
    title: "concert",
  },
  {
    id: "event-2",
    title: "football match",
  },
  {
    id: "event-3",
    title: "stand-up comedy",
  },
  {
    id: "event-4",
    title: "knowledge quiz",
  },
];

const EventsPage = () => {
  return (
    <>
      <h1>This is page where you can find every events!</h1>
      <p>Search for some...</p>
      <ul>
        {DUMMY_EVENTS.map((event) => (
          <li key={event.id}>{event.title}</li>
        ))}
      </ul>
    </>
  );
};

export default EventsPage;
